const url = 'http://'+urlAddress.ip+':8080/api/';
console.log(urlAddress.ip);

class CreateDeleteButton extends Component
{
    constructor (props) {
        super(props);
        this.state = {
            message:'',
          
        };
    }

    deleteAccount(){
        // let message = '';

        if(this.state.message === " Delete account") {
            alert("Are sure you want to delete the account..this is will delete all the appointments");
        }
        else if(this.state.message === "ok") {
            axios.delete(url + `users/4`)
            .then(response =>{
                console.log(response)
            })
            .catch(error =>{
                console.log(error);
                alert("Account successfully deleted");           
            })
            window.sessionStorage.clear();
            window.location.reload(true);
        }
    }
