        //     window.sessionStorage.clear();
        //     window.location.reload(true);
        //}
    
        render(){
               return (   
                 <Container >
                    <Button
                        id="btnDelete" type="Button"
                         value="Delete"
                        variant="danger" 
                        style={{ marginRight: '0%' }}
                        className="Button"
                        onClick={() => this.deleteAccount()}
                        //href="/login"
                        >
                          
                        Delete account
                    </Button>
                 </Container>
                 
               );
               
           }
}

         
      export default CreateDeleteButton;
